import React from 'react';

const PetList = (props) => {

console.log(props);

  const onHandleFeedDino = () => {
    props.handleFeedDino();
  }

  return (
    <>
    {props.list.occupants.map(occupant => (
      <div className ="list_item" key={occupant.id}>
          <p>Name: {occupant.name}</p>
          <p>Species: {occupant.type}</p>
          <p>Fed: {occupant.fed.toString()}</p>
          <button onClick={onHandleFeedDino}>Feed Dino</button>
      </div>
    ))}
    </>
  )
}



export default PetList;
